import React from 'react';
import penguinGif from 'https://www.google.com/url?sa=i&url=https%3A%2F%2Ftenor.com%2Fview%2Fpenguin-walk-gif-8159662&psig=AOvVaw317zeyImwr5KYzmPj6OjMM&ust=1683205827646000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCND4vL2c2f4CFQAAAAAdAAAAABAE'

function Error (){
  return (
    <>
      <h2>404</h2>
      <p>page not found</p>
      <img src={logo} alt="penguin" />
      <Link to='/'>back home</Link>
    </>
  );
}

export default Error;
